import React from 'react';
import styles from '../css/Login.module.css';

function Login() {
  return (
    <div className={styles.container}>
      <div className={styles.background} />
      <div className={`${styles.box} ${styles.box1}`} />
      <div className={`${styles.box} ${styles.box2}`} />
      <div className={`${styles.box} ${styles.box3}`} />
      <div className={`${styles.box} ${styles.box4}`} />
      <div className={styles.mainBox} />
      <div className={styles.divider}></div>
      <div className={`${styles.userTypeText} ${styles.admin}`}>관리자</div>
      <div className={`${styles.userTypeText} ${styles.parent}`}>학부모</div>
      <div className={`${styles.userTypeText} ${styles.professor}`}>교수</div>
      <div className={`${styles.userTypeText} ${styles.student}`}>학생</div>
      <div className={styles.loginButton}></div>
      <div className={styles.loginText}>LOGIN</div>
    </div>
  );
}

export default Login;
